contracts/NFTSubscriptionPlans.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

contract NFTSubscriptionPlans is ERC721URIStorage{
    // TokenURI of each category
    string private BasicTokenURI;
    string private IntermediateTokenURI;
    string private PremiumTokenURI;

    // Predicta token address
    address PredictaTokenAddress;

    // Minting Fees
    uint256 BasicMintingFees = 20 * 10**18;
    uint256 IntermediateMintingFees = 50 * 10**18;
    uint256 PremiumMintingFees = 100 * 10**18;

    mapping (uint256 => string) private NFTsCategoriesNames; // category id > category names
    mapping (address => uint256) private NFTOwnedPerUser; //address > cateogry id
    mapping (address => mapping (uint256 => uint256)) private MaxPerCatoegoryOfOneUser; // maximum of minting nfts per category of one user is 1
    mapping (uint256 => uint256) private CountUsersPerCategory; // cateogry id > Count of users
    mapping (address => uint256) private OwnedNFT; // user address > NFT token id
    uint256 currentNFTid;
    constructor (string memory _categoryone, string memory _categorytwo , string memory _categorythree , address _PredictaTokenAddress ) ERC721 ("NFTAuthenticationAuthorization","NFTAA"){
        NFTsCategoriesNames[1] = _categoryone;  //  Basic user
        NFTsCategoriesNames[2] = _categorytwo; // Intermediate user
        NFTsCategoriesNames[3] = _categorythree; // Premium user
        BasicTokenURI= "https://ipfs.io/ipfs/bafyreiebj6o3hfslbiwwb6gofhbe6p6qk7plhqpn4xxxftnnlxd7vccyam/metadata.json";
        IntermediateTokenURI= "https://ipfs.io/ipfs/bafyreihntmxssaalewqqqvj2aq7hsoimyari2zlsjb5qnajuf6obf3rkn4/metadata.json";
        PremiumTokenURI= "https://ipfs.io/ipfs/bafyreigfobdkn6a2idrbaqs2vyhuvvdvdlbsbl2bpard3lnz7hv2v7htx4/metadata.json";
        PredictaTokenAddress = _PredictaTokenAddress;
    }

    // Minting NFT function
    function MintNFT (uint256 _categoryid) public {
        require (_categoryid >= 1 && _categoryid <=3,"Wrong category id");
        currentNFTid ++;
        // Basic
        if (_categoryid == 1){
            require (MaxPerCatoegoryOfOneUser[msg.sender][2] == 0 && MaxPerCatoegoryOfOneUser[msg.sender][3] == 0 , "You have already in another plan, why you need the basic ?");
            require(MaxPerCatoegoryOfOneUser[msg.sender][1] < 1 , "User should have one nft per category (Basic)");
            IERC20(PredictaTokenAddress).transferFrom(msg.sender, address(this), BasicMintingFees);
            _safeMint(msg.sender, currentNFTid);
            _setTokenURI(currentNFTid, BasicTokenURI);
            NFTOwnedPerUser[msg.sender] = 1;
            OwnedNFT[msg.sender] = currentNFTid;
            MaxPerCatoegoryOfOneUser[msg.sender][1] ++;
            CountUsersPerCategory[1] ++;
        } 
        // Intermediate
        if (_categoryid == 2){
            require (MaxPerCatoegoryOfOneUser[msg.sender][1] == 0 && MaxPerCatoegoryOfOneUser[msg.sender][3] == 0 , "You have already in another plan, why you need the Intermediate ?");
            require(MaxPerCatoegoryOfOneUser[msg.sender][2] < 1 , "User should have one nft per category (Intermediate)");
            IERC20(PredictaTokenAddress).transferFrom(msg.sender, address(this), IntermediateMintingFees);
            _safeMint(msg.sender, currentNFTid);
            _setTokenURI(currentNFTid, IntermediateTokenURI);
            NFTOwnedPerUser[msg.sender] = 2;
            OwnedNFT[msg.sender] = currentNFTid;
            MaxPerCatoegoryOfOneUser[msg.sender][2] ++;
            CountUsersPerCategory[2] ++;
        } 
        // Premium
        if (_categoryid == 3){
            require (MaxPerCatoegoryOfOneUser[msg.sender][1] == 0 && MaxPerCatoegoryOfOneUser[msg.sender][2] == 0 , "You have already in another plan, why you need the Premium ?");
            require(MaxPerCatoegoryOfOneUser[msg.sender][3] < 1 , "User should have one nft per category (Premium)");
            IERC20(PredictaTokenAddress).transferFrom(msg.sender, address(this), PremiumMintingFees);
            _safeMint(msg.sender, currentNFTid);
            _setTokenURI(currentNFTid, IntermediateTokenURI);
            NFTOwnedPerUser[msg.sender] = 3;
            OwnedNFT[msg.sender] = currentNFTid;
            MaxPerCatoegoryOfOneUser[msg.sender][3] ++;
            CountUsersPerCategory[3] ++;
        } 
    }

    // Function to cancel current plan
    function CancelCurrentPlan (uint256 _categoryid) public {
        // Basic
        if (_categoryid == 1){
            require(NFTOwnedPerUser[msg.sender] == _categoryid , "you do not own basic nft");
            uint256 ownedtokeid = GetMyNFTTokenId();
            _burn(ownedtokeid);
            delete NFTOwnedPerUser[msg.sender];
            delete OwnedNFT[msg.sender];
            MaxPerCatoegoryOfOneUser[msg.sender][1] --;
            CountUsersPerCategory[1] --;
        } 
        // Intermediate
        if (_categoryid == 2){
            require(NFTOwnedPerUser[msg.sender] == _categoryid , "you do not own intermediate nft");
            uint256 ownedtokeid = GetMyNFTTokenId();
            _burn(ownedtokeid);
            delete NFTOwnedPerUser[msg.sender];
            delete OwnedNFT[msg.sender];
            MaxPerCatoegoryOfOneUser[msg.sender][2] --;
            CountUsersPerCategory[2] --;
        }
        // Premium 
        if (_categoryid == 3){
            require (NFTOwnedPerUser[msg.sender] == _categoryid , "you do not own premium nft");
            uint256 ownedtokeid = GetMyNFTTokenId();
            _burn(ownedtokeid);
            delete NFTOwnedPerUser[msg.sender];
            delete OwnedNFT[msg.sender];
            MaxPerCatoegoryOfOneUser[msg.sender][3] --;
            CountUsersPerCategory[3] --;
        } 
    }
    
    // Function to retrieve which nft category that a msg.sender user have
    function GetNFTCategoryOfUser () public view returns (uint256){
        return NFTOwnedPerUser[msg.sender];
    } 

    // Function to retrieve which nft category that a msg.sender user have
    function GetNFTCategoryOfSpecificUser(address _UserAddress) public view returns (uint256){
        return NFTOwnedPerUser[_UserAddress];
    }

    // Function to retrieve which nft token id that a msg.sender user have

    function GetMyNFTTokenId () public view returns (uint256){
        return OwnedNFT[msg.sender];
    } 
    
    // Function to retrieve the cateogry name 
    function GetCategoryName (uint256 _categoryid) public view returns (string memory){
        return NFTsCategoriesNames[_categoryid];
    }

    // Function to retrieve the basic minting fees
    function GetBasicMintingFees () public view returns (uint256){
        return BasicMintingFees;
    }
    // Function to retrieve the Intermediate minting fees
    function GetIntermediateMintingFees () public view returns (uint256){
        return IntermediateMintingFees;
    }
       // Function to retrieve the Premium minting fees
    function GetPremiumMintingFees () public view returns (uint256){
        return PremiumMintingFees;
    }

}

contracts/Predicta.sol.content:
// SPDX-License-Identifier: MTI
pragma solidity >=0.7.0 <0.9.0;

import "./NFTSubscriptionPlans.sol";

contract Predicta {
    NFTSubscriptionPlans private nftsubscriptionplans;
    address private ContractOwner;
    address private predictatokenaddress;
    uint256 CurrentEventId;
    mapping (address => mapping (uint256 => uint256)) private MaxVotesPerUsers; // user address > his plan id (basic or intermediate or premium) > count of votes
    mapping (address => mapping (uint256 => bool)) private IsVoted; // user address > Event id > is voted or not 
    mapping (address => mapping (uint256 => bool)) private IsCreatedThatEvent; // user address > Event id >  is created that event or not
    mapping (uint256 => address []) private UsersVotedYes;  // Event id > array of user address
    mapping (uint256 => address []) private UsersVotedNo;   // Event id > array of user address

    constructor (address _NFTSubscriptionPlansAddress , address _PredictaTokenAddress){
        nftsubscriptionplans = NFTSubscriptionPlans(_NFTSubscriptionPlansAddress);
        predictatokenaddress = _PredictaTokenAddress;
        ContractOwner = msg.sender;
    }   
    struct Event {
        address EventCreator;
        uint256 EventId;
        string EventName;
        string EventDescription;
        uint256 EventCategory; // 1 for financial   2 for sport   3 for social 
        uint256 YesVotes;
        uint256 NoVotes;
        bool IsEnded;
    }

    Event []  Events;

    // Function to create events 
    // Owner of contract can create the events 
    // Premium Users only can also create events.
    function CreateEvent (string memory _EventName , string memory _EventDescription , uint256 _EventCategory) public {
        // Check the caller is a premium user or not
        address CallerAddress = msg.sender;
        require ( nftsubscriptionplans.GetNFTCategoryOfSpecificUser(CallerAddress) == 3 , "YOu have to be contract owner or premium user to create events"); 
        CurrentEventId ++;
        Event memory newevent = Event (msg.sender,CurrentEventId,_EventName,_EventDescription,_EventCategory,0,0,false);
        Events.push(newevent);
        IsCreatedThatEvent[msg.sender][CurrentEventId]= true;

    }

    // Function resposnsible for ending events, leaderboard, and sending rewards to users who voted correctly
    function EndEvent (uint256 _EventId, uint256 _EventCorrectVote) public {
        // _EventCorrectVote is 0 or 1 : 0 for No  or  1 for Yes
        require (IsCreatedThatEvent[msg.sender][_EventId] == true , "You could not end that event, you are not the event's creator");
        for (uint256 i = 0 ; i < Events.length ; i++){
            Event storage CurrentEvent = Events[i];
            if (CurrentEvent.EventId == _EventId ){
                require (CurrentEvent.IsEnded == false , "You can not end an ended event");
                CurrentEvent.IsEnded = true;
            }
        }
        // If correct vote is NO
        if (_EventCorrectVote == 0 ){
            address [] memory usersvotedno = UsersVotedNo[_EventId];
            for (uint256 i = 0 ; i < usersvotedno.length ; i++ ){
                address UserAddress = usersvotedno[i];
                // If Basic user 
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(UserAddress) == 1){
                    IERC20(predictatokenaddress).transfer(UserAddress,10 * 10**18);
                }
                // If Intermediate user 
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(UserAddress) == 2){
                    IERC20(predictatokenaddress).transfer(UserAddress,20 * 10**18);
                }
                // If Premium user 
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(UserAddress) == 3){
                    IERC20(predictatokenaddress).transfer(UserAddress,30 * 10**18);
                }
            }
        }
        // If correct vote is Yes
        if (_EventCorrectVote == 1 ){
            address [] memory usersvotedyes = UsersVotedYes[_EventId];
                       for (uint256 i = 0 ; i < usersvotedyes.length ; i++ ){
                address UserAddress = usersvotedyes[i];
                // If Basic user 
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(UserAddress) == 1){
                    IERC20(predictatokenaddress).transfer(UserAddress,10 * 10**18);
                }
                // If Intermediate user 
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(UserAddress) == 2){
                    IERC20(predictatokenaddress).transfer(UserAddress,20 * 10**18);
                }
                // If Premium user 
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(UserAddress) == 3){
                    IERC20(predictatokenaddress).transfer(UserAddress,30 * 10**18);
                }
            }
            
        }
    }

    // Function to vote on events 
    function VoteOnEvents (uint256 _EventId, uint256 _YesOrNo) public {
        // _EventId is the event id 
        // _YesOrNo is 1 or 0
        address CallerAddress = msg.sender;
        require ( nftsubscriptionplans.GetNFTCategoryOfSpecificUser(CallerAddress) == 1 || nftsubscriptionplans.GetNFTCategoryOfSpecificUser(CallerAddress) == 2 || nftsubscriptionplans.GetNFTCategoryOfSpecificUser(CallerAddress) == 3 , "You need to subscribe on predicta to vote on events");
        // if basic user
        require(IsVoted[msg.sender][_EventId] == false,"You have voted on that event before");
        for (uint256 i=0 ; i< Events.length ; i++){
            if (Events[i].EventId == _EventId){
               require ( Events[i].IsEnded == false ,"the event is ended");
                Event storage TargetEvent = Events[i];
                // Basic users
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(CallerAddress) == 1){
                    require(MaxVotesPerUsers[msg.sender][1] <= 5, "Basic user can only vote 5 votes on events");
                    // Basic users have voting power of 1
                    if (_YesOrNo == 0){
                        TargetEvent.NoVotes ++ ;
                        UsersVotedNo[_EventId].push(msg.sender);
                    }
                    if (_YesOrNo == 1){
                        TargetEvent.YesVotes ++ ;
                        UsersVotedYes[_EventId].push(msg.sender);
                    }
             
                    MaxVotesPerUsers[msg.sender][1] ++;
                    
                }
                // Intermediate users
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(CallerAddress) == 2){
                    require(MaxVotesPerUsers[msg.sender][2] <= 10, "Intermediate user can only vote 10 votes on events");
                    // Intermediate users have voting power of 2
                    if (_YesOrNo == 0){
                        TargetEvent.NoVotes = TargetEvent.NoVotes + 2 ;
                        UsersVotedNo[_EventId].push(msg.sender);
                    }
                    if (_YesOrNo == 1){
                        TargetEvent.YesVotes = TargetEvent.YesVotes + 2 ;
                        UsersVotedYes[_EventId].push(msg.sender);
                    }
                    MaxVotesPerUsers[msg.sender][2] ++;
                }
                // Premium users
                if (nftsubscriptionplans.GetNFTCategoryOfSpecificUser(CallerAddress) == 3){
                    require(MaxVotesPerUsers[msg.sender][1] <= 20, "Premium user can only vote 20 votes on events");
                    // Premium users have voting power of 3
                    if (_YesOrNo == 0){
                        TargetEvent.NoVotes = TargetEvent.NoVotes + 3 ;
                        UsersVotedNo[_EventId].push(msg.sender);
                    }
                    if (_YesOrNo == 1){
                        TargetEvent.YesVotes = TargetEvent.YesVotes + 3  ;
                        UsersVotedYes[_EventId].push(msg.sender);
                    }
                    MaxVotesPerUsers[msg.sender][3] ++;
                }
            }
        }
        IsVoted[msg.sender][_EventId] = true;
    }

    // Function to get the Events array
    function GetAllEvents () public view returns (Event [] memory){
        return Events;
    }

}

